import profileImg from "../images/profile.svg"

export default function StudentDashboard({courseModel}){
    const findCourse = courseModel.filter(({students}) =>  {
        return students.some(({name}) => name === "Manav Singh");
    });

    const enrolledCourse = findCourse.map(({name, instructor, thumbnail, due, progress}) => {
        return(
            <div>
                <h4>{name}</h4>
                <img alt="course" src={thumbnail}/>
                <p>Instructor: {instructor}</p>
                <p>Due date: 29th Feb, 2024</p>
                <p>Progress bar======== 85%</p>
            </div>
        );
    })
    return(
        <div>
            <img alt="student alias" src={profileImg}/>
            <div>
                <h2>Manav Singh</h2>
                <p>A computer science graduate, who loves to code and play with computers.</p>
                <p>Email: manav@example.com</p>
            </div>
            <h3>List of Enrolled Courses: </h3>
            {enrolledCourse}
        </div>
    );
}
